import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";
import server from "./server";

if (process.env.NODE_ENV === "development") {
  // server();
}
ReactDOM.createRoot(document.getElementById("root")).render(<App />)

